var Geoservices = require('../geoservices-js');

var client = new Geoservices();

client.options = {geocoderUrl: "https://foo.arcgis.com/arcgis/rest/services/GeocodeServer"};

client.geocode({text:"disneyland", f:"foo"}, function (err, result) {
  console.log("ERR: " + JSON.stringify(err));
  console.log("results: " + JSON.stringify(result));
});